package main

import (
	"fmt"
	"io"
	"net/http"
	"net/url"
)

const largeHeader = ""

func main() {
	req := &http.Request{
		Method: "GET",
		URL:    &url.URL{Scheme: "http", Host: "172.18.255.200", Path: "/get"},
		Header: http.Header{
			"x-large-size-header": []string{largeHeader},
		},
	}

	client := &http.Client{}
	resp, err := client.Do(req)
	if err != nil {
		panic(err)
	}

	defer resp.Body.Close()

	b, _ := io.ReadAll(resp.Body)
	fmt.Println("StatusCode: ", resp.StatusCode)
	fmt.Println("Body: ", string(b))

}
